import{_ as t,o as a,c as i,a0 as o}from"./chunks/framework.CWhA0Xec.js";const g=JSON.parse('{"title":"01. The AI Stack: Your New Development Team","description":"","frontmatter":{},"headers":[],"relativePath":"curriculum/ai_skills/01_the_ai_stack.md","filePath":"curriculum/ai_skills/01_the_ai_stack.md"}'),r={name:"curriculum/ai_skills/01_the_ai_stack.md"};function n(l,e,s,h,d,c){return a(),i("div",null,[...e[0]||(e[0]=[o('<h1 id="_01-the-ai-stack-your-new-development-team" tabindex="-1">01. The AI Stack: Your New Development Team <a class="header-anchor" href="#_01-the-ai-stack-your-new-development-team" aria-label="Permalink to &quot;01. The AI Stack: Your New Development Team&quot;">‚Äã</a></h1><blockquote><p><strong>Goal:</strong> Understand the tools that will write 80% of your code.</p></blockquote><p>In this course, you are <strong>not</strong> the coder. You are the <strong>Product Manager (PM)</strong> and the <strong>Code Reviewer</strong>. The AI is your Senior Engineer.</p><hr><h2 id="_1-the-core-toolkit" tabindex="-1">1. The Core Toolkit <a class="header-anchor" href="#_1-the-core-toolkit" aria-label="Permalink to &quot;1. The Core Toolkit&quot;">‚Äã</a></h2><h3 id="üß†-the-brains-claude-3-5-sonnet-google-antigravity" tabindex="-1">üß† The Brains: Claude 3.5 Sonnet / Google Antigravity <a class="header-anchor" href="#üß†-the-brains-claude-3-5-sonnet-google-antigravity" aria-label="Permalink to &quot;üß† The Brains: Claude 3.5 Sonnet / Google Antigravity&quot;">‚Äã</a></h3><p>These are the models that understand complex instructions, refactoring, and project architecture.</p><ul><li><strong>Role:</strong> Writing logic, generating tests, planning refactors.</li><li><strong>When to use:</strong> &quot;Write a Python script to parse this CSV.&quot;</li></ul><h3 id="üíª-the-hands-claude-code-antigravity-terminal" tabindex="-1">üíª The Hands: <code>claude.code</code> / Antigravity Terminal <a class="header-anchor" href="#üíª-the-hands-claude-code-antigravity-terminal" aria-label="Permalink to &quot;üíª The Hands: `claude.code` / Antigravity Terminal&quot;">‚Äã</a></h3><p>These are the command-line interfaces (CLI) that give the AI access to your file system.</p><ul><li><strong>Role:</strong> Creating files, running tests, fixing lint errors.</li><li><strong>Capability:</strong> They can investigate the codebase, read files, and edit them directly.</li></ul><h3 id="üìù-the-editor-vs-code-cursor-zed" tabindex="-1">üìù The Editor: VS Code / Cursor / Zed <a class="header-anchor" href="#üìù-the-editor-vs-code-cursor-zed" aria-label="Permalink to &quot;üìù The Editor: VS Code / Cursor / Zed&quot;">‚Äã</a></h3><p>Your view into what the AI is doing. Works on Mac, Windows, and Linux.</p><ul><li><strong>Role:</strong> Code review, small manual tweaks, Git operations.</li></ul><hr><h2 id="_2-the-mental-model-shift" tabindex="-1">2. The Mental Model Shift <a class="header-anchor" href="#_2-the-mental-model-shift" aria-label="Permalink to &quot;2. The Mental Model Shift&quot;">‚Äã</a></h2><table tabindex="0"><thead><tr><th style="text-align:left;">Old Way (Manual)</th><th style="text-align:left;">New Way (Agentic)</th></tr></thead><tbody><tr><td style="text-align:left;">You write the function.</td><td style="text-align:left;">You write the <em>spec</em> for the function.</td></tr><tr><td style="text-align:left;">You Google syntax errors.</td><td style="text-align:left;">You paste the error to the Agent.</td></tr><tr><td style="text-align:left;">You manually run tests.</td><td style="text-align:left;">You ask the Agent to &quot;run tests and fix failures&quot;.</td></tr><tr><td style="text-align:left;"><strong>Time spent:</strong> 90% Coding, 10% Planning</td><td style="text-align:left;"><strong>Time spent:</strong> 80% Planning/Review, 20% Tweaking</td></tr></tbody></table><h2 id="_3-setup-checklist" tabindex="-1">3. Setup Checklist <a class="header-anchor" href="#_3-setup-checklist" aria-label="Permalink to &quot;3. Setup Checklist&quot;">‚Äã</a></h2><ul><li>[ ] Install the CLI tool (e.g., <code>npm install -g @anthropic/claude-code</code> or internal equivalent).</li><li>[ ] Authenticate with your API key.</li><li>[ ] Verify access by running: <code>claude &quot;what time is it?&quot;</code></li><li>[ ] Create an alias for speed (e.g., <code>alias c=&quot;claude&quot;</code>).</li></ul><h2 id="_4-first-run-exercise" tabindex="-1">4. First Run Exercise <a class="header-anchor" href="#_4-first-run-exercise" aria-label="Permalink to &quot;4. First Run Exercise&quot;">‚Äã</a></h2><p>Run this command in your terminal:</p><div class="language-bash vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">claude</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> &quot;Create a file named hello_agent.py that prints a random compliment to the user. Run it to verify it works.&quot;</span></span></code></pre></div><p>Observe how the agent:</p><ol><li>Plans the action.</li><li>Creates the file.</li><li>executes the file.</li><li>Returns the output.</li></ol><p><strong>This is your new workflow.</strong></p>',25)])])}const p=t(r,[["render",n]]);export{g as __pageData,p as default};
